import React from 'react';
import { Row, Col, Icon, Card, CardTitle, CollapsibleItem, Collapsible, Button } from 'react-materialize';
import "./style.css";

function Home(props) {
  if (props.user.trim() == "") {
    return (
      <Row>
        <Col
          m={6}
          s={6}
        >
          <Card
            actions={[
              <a key="1" href="#">Sing up</a>
            ]}
            closeIcon={<Icon>close</Icon>}
            header={<CardTitle image="https://ideas.staticsfly.com/ideas/wp-content/uploads/2018/10/you-got-this-list-1.jpg">Well To Do</CardTitle>}
            revealIcon={<Icon>more_vert</Icon>}
          >
            Organize your tasks never miss deadline!!.
    </Card>
        </Col>
      </Row>
    );
  } else {
    return (
      <div>
        <Collapsible
          accordion
          popout
        >
          <CollapsibleItem
            expanded={false}
            header="What to do for morning."
            icon={<Icon>checkbox</Icon>}
            node="div"
          >
            Clean the Bathroom
  </CollapsibleItem>
          <CollapsibleItem
            expanded={false}
            header="What to do for noon."
            icon={<Icon>checkbox</Icon>}
            node="div"
          >
            Do your Homework.
  </CollapsibleItem>
          <CollapsibleItem
            expanded={false}
            header="What to do for evening"
            icon={<Icon>checkbox</Icon>}
            node="div"
          >
            Eat your dinner.
  </CollapsibleItem>
        </Collapsible>
        <div>
          <Button className="AddButton"
            flat
            node="button"
            style={{
              marginRight: '75px'
            }}
            waves="light"
          >
            New To Do
  </Button>
          <Button
            floating
            icon={<Icon>add</Icon>}
            large
            node="button"
            waves="light"
          />
        </div>
      </div>

    );
  }
}

export default Home;
